We regularly assist "professionals in transition" with their lodging needs, but we have JUST encountered a family`s situation that we cannot help, so we need to see if someone else can. We can make this arrangement very attractive financially to you. Considerably ABOVE market rates. In a word, a family of four - two parents, two teen-agers - have just had suddenly to depart their overseas assignment, and will be taking a domestic assignment. They are indeed seeking to buy a home, but, for the short/transition time, while finding the home and doing the settlement process, maybe up to three months, they need lodging for themselves that must be:
&gt;&gt; furnished;
&gt;&gt; available by 15 August (earlier is better);
&gt;&gt; two bedrooms or more;
&gt;&gt; sub-leasable to them (better still will be leasable to me, and I can sub-lease to them);
&gt;&gt; in the City of Falls Church.
Again, we can make this arrangement financially very attractive to you. Considerably ABOVE market rates.
